import React from 'react';

class Table2 extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
      error: null,
      isLoaded: false,
      docs: []
    };
  }

  componentDidMount() {
    fetch('http://localhost:5000/view')
      .then(res => res.json())
      .then(
        (result) => {
          this.setState({
            isLoaded: true,
            docs: result
          });
        },
        // error handler
        (error) => {
          this.setState({
            isLoaded: true,
            error
          });
        }
      )
  }

  render() {

    const { error, isLoaded, docs } = this.state;

    if (error) {
      return (
        <div className="col">
          Error: {error.message}
        </div>
      );
    } else if (!isLoaded) {
      return (
        <div className="col">
          Loading...
        </div>
      );
    } else {
      return (
        <div className="col">
          <h1>Mi Casa</h1>
          <p>This is my house y'all!</p>
          <p>Stuff: {docs}</p>
        </div>
      );
    }
  }
}

export default Table2;
